function CKupdate() {
    if (typeof CKEDITOR != "undefined") {
        for (instance in CKEDITOR.instances) {
            CKEDITOR.instances[instance].updateElement()
        }
    }
}

function show_miniloading(a) {
    if (a.is("button")) {
        a.attr("disabled", "disabled");
        if (a.find(".mini-loader-image").length == 0) {
            a.append($("#mini-loader").html())
        }
    } else {
        if (a.is("form")) {
            a.find(":submit").attr("disabled", "disabled");
            if (a.find(":submit").find(".mini-loader-image").length == 0) {
                a.find(":submit").append($("#mini-loader").html())
            }
        } else {
            if (a.is("a")) {
                a.attr("disabled", "disabled");
                if (a.find(".mini-loader-image").length == 0) {
                    a.append($("#mini-loader").html())
                }
            }
        }
    }
}

function hide_miniloading(a) {
    if (a.is("button")) {
        a.removeAttr("disabled");
        a.find("img").remove()
    } else {
        if (a.is("form")) {
            a.find(":submit").removeAttr("disabled");
            a.find(":submit").find("img").remove()
        } else {
            if (a.is("a")) {
                a.removeAttr("disabled");
                a.find("img").remove()
            }
        }
    }
    $(".file-upload-message").remove()
}

